import React from "react";
import { Layout, Avatar, Menu, Button, Row, Col } from "antd";
import { DownloadOutlined } from "@ant-design/icons";
const { Header, Footer, Slider, Content } = Layout;
import Title from "antd/lib/typography/Title";
// import utilCss from "../styles/app.module.css";
//import Style from "../styles/home.css";

export default function home() {
  return (
    <>
      <Layout className="layout">
        <Header>
          <div className="logo">
            <img style={{ borderRadius: "4px" }} src="./images/logo2.jpeg" />
          </div>
          <Menu
            style={{
              float: "right",
              backgroundColor: "transparent !important",
              color: "#d8d8d8",
            }}
            mode="horizontal"
            defaultSelectedKeys={["1"]}
          >
            <Menu.Item key="1" className="customclass">
              Home
            </Menu.Item>
            <Menu.Item key="2" className="customclass">
              OUR FOOD
            </Menu.Item>
            <Menu.Item key="3" className="customclass">
              PLANS
            </Menu.Item>
            <Menu.Item>
              <Button
                style={{
                  borderRadius: "12px",
                  backgroundColor: "#74cf4e",
                  color: "white",
                }}
                // type="sucess"
                // icon={<DownloadOutlined />}
              >
                Signup / login
              </Button>
            </Menu.Item>
          </Menu>
        </Header>
        <Row className="headerBg" gutter={[16, 24]}>
          <Col className="gutter-row" span={13} style={{ marginTop: "112px" }}>
            <Row style={{ marginLeft: "162px" }}>
              {" "}
              <Col className="gutter-row" span={10}>
                <img src="./images/leaf.png" style={{ width: "15%" }} />
              </Col>
              <Col className="gutter-row" span={14}>
                <img
                  src="./images/chilli.png"
                  style={{ marginLeft: "227px", width: "12%" }}
                />
              </Col>
            </Row>

            <div>
              <h1 style={{ fontSize: "60px", textAlign: "center" }}>
                Have No time
                <br /> to prepare <span style={{ color: "#74cf4e" }}>
                  food
                </span>{" "}
                ?
              </h1>
            </div>
            <Col style={{ padding: "0", marginLeft: "146px" }}>
              Choose one of our plans, enter delivery time <br /> and enjoy
              delicious food without leaving your place!
            </Col>
            <Col>
              <Button type="primary" shape="round" icon={<DownloadOutlined />}>
                Download
              </Button>
            </Col>
          </Col>
          <Col className="gutter-row" span={11}>
            {" "}
            <img
              style={{ filter: "brightness(74%)" }}
              src="./images/headerBg.png"
            />
          </Col>
        </Row>
      </Layout>
    </>
  );
}
